Attenboroughs Journey (BBC)

Nature Documentary hosted by Cherie Lunghi, published by BBC in 2010 - English narration


Information
------------------------------

Following David Attenborough as he travels the globe to film his series, David Attenborough's First Life, in which he explores the very origins of life on Earth. David journeys to the parts of the world which have had special meaning to him during his 50 years of broadcasting. Beginning near his boyhood Leicestershire home, where he first collected fossils, he then travels to Morocco's arid deserts, the glaciers of Canada and crystal clear waters of Australia's Great Barrier Reef.

